body:
We want to make the commit logic extensible and optimized on a store-by-store basis. It should be extensible so external services (catalogs) can be used as locking clients if need be.

The API might look like:

```rust
/// A store that can atomically commit a manifest to some path.
trait CommitStore {
   async fn try_commit_manifest(manifest: &Manifest, path: &Path) -> Result<(), CommitError>
}

enum CommitError {
    /// Another transaction has already been written to the path
    CommitConflict,
    /// Something else went wrong
    OtherError(lance::Error)
}
```

How does this get added to the store? First, we can provide a default implementation for each object store, based on it's native atomic put/replace APIs. Then we can add a parameter to `ObjectStoreParams` to allow replacing this with something that will call into a catalog.

Right now, to commit a new version of a dataset the client must construct a Manifest correctly. This is a bit dangerous as serious issues could be caused by not constructing this correctly. In addition, manifests aren't easy to use to do conflict resolution on transactions.

We should switch to an API around transactions, that allow committing a transaction to a dataset, rather than a completely constructed state.

There could be a struct:

```rust
pub struct Transaction {
    updated_metadata: DatasetMetadata,
    new_fragments: Vec<Fragment>,
    updated_fragments: Vec<Fragment>,
    deleted_fragment_ids: Vec<u32>,
}
```

Then to commit a transaction, you could call either:

```rust
impl Dataset {
    /// Commit a transaction to an existing table
    pub async fn commit(
        &mut self,
        transaction: Transaction,
        retry_config: RetryConfig,
    ) -> Result<()> { ... }

    /// Commit a new table
    pub async fn commit_new(transaction: Transaction) -> Result<Self> { ... }
}
```

These methods could perform validation to make sure the transaction is correct, and can construct a valid manifest based on the state of the table. If a concurrent transaction beats the commit, then it could attempt to rebuild the manifest to create the next transaction, if that is allowed by conflict resolution algorithms.

# Problem Statement

Currently, we only have one `Dataset::write()` method, which requires to open dataset everytime, and needs user to remember what the base URI is. 

We should have an `append()` method that takes `&self`, so it is easy for user to hold an Dataset instance and run append many times.

```rust
impl Dataset {
   pub async fn append(&self, batches: &mut Box<dyn RecordBatchReader>) {}
}

```

I have a method on an ingestor struct:

``` rust
pub async fn write(&self, buffer: TemporalBuffer) -> Result<Dataset> {
        let mut reader: Box<dyn RecordBatchReader> =
            Box::new(RecordBatchBuffer::new(buffer.batches));

        let dataset =
            Dataset::write(&mut reader, self.filename.as_ref(), Some(self.write_params)).await?;

        Ok(dataset)
    }
```

upstream when I have a task that listens for these buffers on a channel and passes them to the ingestor in an infinite loop:

```rust
let mut tasks = Joinset::new()
// ...
tasks.spawn(async move {
        loop {
            let buf = rx_buffer.recv().await?;
            ingestor.write(buf).await?;
        }
});
```

Because Dataset::write takes a trait object that doesn't require a Send bound I have a nightmare because Joinset::spawn requires its futures are ```Send```.

I'll confess I'm not the best at this level of rust, but it seems like the issue would disappear if write used static dispatch instead of dynamic dispatch ```Dataset::write<R: RecordBatchReader>(...)```

If anyone else has any ideas for how to mitigate this I'm open to suggestions.

Thanks!
